In javascript output the values in a dictionary sorted by key alphabetically.
Here's an example of how you can sort a JavaScript object based on its keys using `sort()` method and then iterate over it to print out each value with their respective key name:
```javascript
const data = {a: 1, b: 2, c: 3}; // sample input data
// sorting the objects by alphabetical order of keys
data.sort((key1, key2) => key1.localeCompare(key2));
console.log('Sorted Data:');
for (let i = 0; i < Object.keys(data).length; i++) { // iterate over the sorted data and print out each value with their respective keys
  console.log(`${Object.keys(data)[i]}: ${data[Object.keys(data)[i]]}`);
}
```
